Wondering if I can get some more reviews please?'}, {'account_id': 28411, 'date': '2018-07-31 16:48:12.000000000', 'content': 'Patch Set 1:

Instead of duplicated code how about we have a quick check if that part is added or not and set it, something-ish like:

TRUST_SCOPE=""
if [ -n "${TRUST_ID}" ]; then 
  TRUST_SCOPE=",
        "scope": {
            "OS-TRUST:trust": {
                "id": "$TRUST_ID"
            }
        }"
fi

auth_json=$(cat << EOF
{
    "auth": {
        "identity": {
            "methods": [
                "password"
            ],
            "password": {
                "user": {
                    "id": "${TRUSTEE_USER_ID}",
                    "password": "${TRUSTEE_PASSWORD}"
                }
            }
        }${TRUST_SCOPE}
    }
}
EOF'}, {'account_id': 7069, 'date': '2018-09-20 03:22:38.000000000', 'content': 'Uploaded patch set 2.'}, {'account_id': 28411, 'date': '2018-09-24 17:34:28.000000000', 'content': 'Patch Set 2: Code-Review+1

